ultimaApresentacaoProposicao_descricao:
Apresentação do Requerimento n. 26/2012, pela Deputada Liliam Sá (PSD-RJ), que: "Requer que sejam convidados para Audiência Pública o Diretor GeraI do Departamento de Polícia Federal; o Presidente do Conselho Federal da Ordem dos Advogados do Brasil;
o Presidente da Conferência Nacional dos Bispos do Brasil (CNBB); a Secretaria Especial de Políticas de Promoção da Igualdade Racial;
Secretaria de Políticas para Mulheres; a Secretaria de Desenvolvimento Social e Combate à Pobreza.
".

Requer, nos termos do artigo 255 do RICD, a realização de audiência pública para instruir a matéria legislativa em trâmite nesta Comissão Especial com a presença das autoridades abaixo relacionadas:
a) Dr. César Bechara Nader Mattar Júnior, Presidente da Associação Nacional dos Membros do Ministério Público - CONAMP;
b) Dr. Alexandre Camanho de Assis, presidente da Associação Nacional dos Procuradores da República - ANPR;
c) Dr. Sebastião Vieira Caixeta, presidente da Associação Nacional dos Procuradores do Trabalho - ANPT;
d) Dr. Antônio Marcos Dezan, presidente da Associação do Ministério Público do Distrito Federal - AMPDFT;
e) Dr. Marcelo Weitzel R. de Souza, presidente da Associação Nacional do Ministério público Militar - ANMPM.

Requer, nos termos do artigo 255 do RICD, a realização de audiência pública para ouvir as seguintes autoridades: 
a) Dr. Flávio Crocce Caetano, Secretário da Reforma do Judiciário/MJ;
b) Dr. Ophir Filgueiras Cavalcante Junior, Presidente da Ordem dos Advogados do Brasil;
c) Dr. Cláudio Soares Lopes, presidente do Conselho Nacional dos Procuradores Gerais - CNPG;
d) Dr. Mário Bonfaglia, membro do Conselho Nacional do Ministério Público - CNMP.

Requer, nos termos do artigo 255 do RICD, a realização de audiência pública com as autoridades:
a) Ministro Carlos Ayres Britto, Presidente eleito do Supremo Tribunal Federal;
b) Dr. José Eduardo Cardozo, Ministro da Justiça;
c) Dr. Roberto Monteiro Gurgel Santos, Procurador-Geral da República.

Apresentação do Requerimento n. 4/2012, pelo Deputado Fabio Trad (PMDB-MS), que: "Requer realização de Audiências Públicas para ouvir as seguintes autoridades:

· Sr. Divinato da Consolação Ferreira, Presidente da Federação Interestadual dos Policiais Civis;
· Dr. Ophir Filgueiras Cavalcante, Presidente do Conselho Federal da Ordem dos Adv.do Brasil - OAB;
· Dr. Marco Antonio Marques da Silva, Desembargador do Tribunal de Justiça do Estado de São Paulo; 
· Dr. Paulo Alberto de Oliveira, Procurador Geral de Justiça do Estado de Mato Grosso do Sul.
".

Apresentação do Requerimento n. 5/2012, pelo Deputado Fabio Trad (PMDB-MS), que: "Requer realização de Audiências Públicas para ouvir as seguintes autoridades:

· Promotor de Justiça do Estado de Mato Grosso do Sul Sr. Paulo Cezar dos Passos;
· Presidente da Assoc. Nacional dos Delegados de Polícia Federal - ADPF,  Sr. Marcos Leôncio Souza Ribeiro;
· Presidente da Assoc. Nac. dos Membros do Ministério Público - CONAMB, Sr. Cesar Bechara N. Mattar Júnior; 
· Vice-Presidente Parlamentar da Assoc. dos Delegados de Polícia do Brasil - ADEPOL DO BRASIL, Sr. Benito Augusto Galiani Tiezzi.
".

Apresentação do Requerimento n. 6/2012, pelo Deputado Fabio Trad (PMDB-MS), que: "Requer realização de Audiências Públicas para ouvir as seguintes entidades:

· Associação Nacional dos Procuradores da República - ANPR, na pessoa do seu Presidente Sr. Alexandre Camanho de Assis;
·  Departamento de Polícia Federal - DPF, na pessoa de seu Diretor Geral Sr. Leandro Daiello Coimbra;
· Conselho Nacional dos Chefes de Policia Civil - CONCPC, na pessoa de seu Vice-Presidente Sr. Jorge Luiz Xavier; e
. Dr. Humberto de Mattos Brittes, Procurador-Geral Adjunto de Justiça Jurídico do Est. de Mato Grosso do Sul.
".

Apresentação do Requerimento n. 7/2012, pelo Deputado Lourival Mendes (PTdoB-MA), que: "Requer a realização de audiência pública para ouvir as seguintes as autoridades:

a) Dr. José Antonio Dias Toffoli - Ministro do Supremo Tribunal Federal;
b) Dr. Marcus Vinícius Furtado Coelho, Secretário-Geral da Ordem dos Advogados do Brasil;
c) Dr. Alberto José Tavares Vieira da Silva, Desembargador Federal Aposentado e Advogado.
".

Parecer com Complementação de Voto, Dep. Eduardo Azeredo (PSDB-MG), pela aprovação do Substitutivo do Senado Federal, da seguinte forma:
a) Pela rejeição do artigo 9º do Substitutivo do Senado Federal para manter o artigo 7º do texto original do Projeto de Lei nº 84, de 1999, aprovado pelo Plenário da Câmara dos Deputados em novembro de 2003;
b) Pela aprovação dos artigos 15, 18 e 19 do Substitutivo do Senado;
c) Pela aprovação da ementa do substitutivo, exceto as expressões "de rede de computadores, ou" e "dispositivos de comunicação ou"; 
d) Pela aprovação do artigo 1º, exceto as expressões "de rede de computadores, ou" e "dispositivos de comunicação ou";
e) Pela rejeição dos artigos 2º, 3º, 4º, 5º, 6º, 7º, 8º, 10º, 11, 12, 13, 14, 16, 17, 20, 21 e 22.

Apresentação do Requerimento n. 49/2012, pelo Deputado Vicente Candido (PT-SP), que: "Requer a realização de Audiência Pública com os membros da Comissão de Estudos do Novo Código Comercial da AMB - Associação dos Magistrados Brasileiros. Abaixo nominados:
1) Luis Felipe Salomão - Ministro do Superior Tribunal de Justiça;
2) Gilmar Tadeu Soriano - Juiz de Direito do Tribunal de Justiça do Distrito Federal e Territórios;
3) Edilson Enedino das Chagas - Juiz de Direito do Tribunal de Justiça do Distrito Federal Territórios;
4) Paulo Fernando Campos Salles de Toledo - Desembargador do Tribunal de Justiça de São Paulo;
5) Alexandre  Alves Lazzarini - Juiz do Tribunal de Justiça de São Paulo;
6) Marcelo Cavalcante Piragibe Magalhães - Juiz do Tribunal de Justiça de Minas Gerais".

