- União Nacional dos Estudantes - UNE;
- Associação Nacional dos Centros Universitários - ANACEU;
- Associação Brasileira de Universidades Privadas - ANUP;
- Associação Brasileira das Mantenedoras das Faculdades Isoladas e Integradas - ABRAFI; e
